import React from 'react';

function Building(props)
	{
	console.log(props)
		return(
		<>
			<div> BUY: red:{props.buyPrice.red} green:{props.buyPrice.green} blue:{props.buyPrice.blue}</div>
			 <div>SELL: {props.sellPrice} </div>
		<button 
		name={props.name} 
		onClick={props.HandleClick} 
		
		>
		{props.name}
		
		</button>
			<div> COUNT:{props.count}
		</div>
		</>

		)
}


export default Building;
